  #fbtn:hover{
    background-color: lightsteelblue;
  }
  #lbtn:hover{
    background-color: lightsteelblue;
  }
  #subtn{
    width:300px;
    background-color: mediumseagreen;
    font-weight: bold;
    color:black;
    margin-left: 75px;
    letter-spacing: 3px;
  }
  #sibtn{
    color: darkgreen;
    text-decoration: underline;
    background-color: powderblue;
  
  }
  #sibtn:hover{
   background-color: lightblue;
   color:black;
  }
  #mform{
    border:3px solid slategray;
    padding: 10px;
  }
  .form-control{
    text-align: center;
    font-style: italic;
